import React, { useState } from 'react'

const Register = () => {
    const[inpval,setINP]=useState({
        name:"",
        email:"",
        age:"",
        mobile:"",
        work:"",
        add:"",
        desc:""
    })


    const setdata =(e)=>{
            console.log(e.target.value);
            const {name,value}=e.target;
            setINP((preval)=>{
                return{
                    ...preval,
                    [name]:value
                }
                
            })
       
          
            

    }
  

    const addinpdata =async(e)=>{
        e.preventDefault();

        const {name,email,age,mobile,add,desc,work} =inpval;

        const res =await fetch("/register",{
            method:"POST",
            headers:{
                "Content-Type":"application/json"
            },
            body:JSON.stringify({
                name,age,email,work,add,desc,mobile
            })
        });

        const data =await res.json();
        if(res.status === 422 || !data){
            console.log("error");
            alert("please alreasdy exist user");
        }
        if(res.status === 422 || !data){
            console.log("error");
            alert("please fill the  details");
        }
        
        else{
            alert("user details added");
            
            console.log("user details added")
            setINP({
                name: "",
                email: "",
                age: "",
                mobile: "",
                work: "",
                add: "",
                desc: "",
            });
        }

    }

  return (
    <div>
        <div className="container my-5">
        <form >
            <div className="row ">
      <div className="mb-3 col-lg-6 col-md-6 col-12">
        <label for="exampleFormControlInput1" className="form-label">Name</label>
        <input type="text" className="form-control"  value={inpval.name} onChange={setdata}   name="name" id="exampleFormControlInput1" />
    </div>
    <div className="mb-3 col-lg-6 col-md-6 col-12">
        <label for="exampleFormControlInput1" className="form-label">Email address</label>
        <input type="text" className="form-control" value={inpval.email} onChange={setdata}  name='email' id="exampleFormControlInput1" />
    </div>
    <div className="mb-3 col-lg-6 col-md-6 col-12">
        <label for="exampleFormControlInput1" className="form-label">Age</label>
        <input type="number" className="form-control" value={inpval.age} onChange={setdata}  name="age" id="exampleFormControlInput1" />
    </div>
    <div className="mb-3 col-lg-6 col-md-6 col-12">
        <label for="exampleFormControlInput1" className="form-label">Mobile</label>
        <input type="number" className="form-control" value={inpval.mobile} onChange={setdata}  name="mobile" id="exampleFormControlInput1" />
    </div>
    <div className="mb-3 col-lg-6 col-md-6 col-12">
        <label for="exampleFormControlInput1" className="form-label">Work</label>
        <input type="text" className="form-control" value={inpval.work} onChange={setdata}  name="work" id="exampleFormControlInput1" />
    </div>
    <div className="mb-3 col-lg-6 col-md-6 col-12">
        <label for="exampleFormControlInput1" className="form-label">Address</label>
        <input type="text" className="form-control" value={inpval.add} onChange={setdata}  name ="add" id="exampleFormControlInput1" />
    </div>
    
    <div className="mb-3 ">
        <label for="exampleFormControlTextarea1" className="form-label">description</label>
        <textarea className="form-control" name ="desc"  value={inpval.desc} onChange={setdata} id="exampleFormControlTextarea1" rows="5"></textarea>
    </div>
    <div>
        <button onClick={addinpdata}   className=' mt-3 btn btn-primary form-control'>Submit</button>
    </div>
    </div>
    </form>
    </div>
    </div>
  )
}

export default Register
